/* boxed & wide syle */
$(document).ready(function(){ 

	var cookieName = 'wide';
	function changeLayout(layout) {
		$.cookie(cookieName, layout);
		$('head link[name=layout]').attr('href', 'css/layout/' + layout + '.css');
	}

	if( $.cookie(cookieName)) {
		changeLayout($.cookie(cookieName));
	}

	$("#wide").click( function(){ $
		changeLayout('wide');
	});

	$("#boxed").click( function(){ $
		changeLayout('boxed');
	});

});


